import React, { Component } from 'react';

class PlaylistTable extends Component {
    render() {
        return (
            <div className="list-group col-4 mt-5">
            <a href="#" className="list-group-item list-group-item-action active">Active item</a>
            <a href="#" className="list-group-item list-group-item-action">Item</a>
            <a href="#" className="list-group-item list-group-item-action ">Disabled item</a>
          </div>
        );
    }
}

export default PlaylistTable;
